query:
mutation sitesRemoveSocketAddOnCard ( $removeSocketAddOnCardInput:RemoveSocketAddOnCardInput! $accountId:ID! ) {
	sites ( accountId:$accountId ) {
		removeSocketAddOnCard ( input:$removeSocketAddOnCardInput  )  {
			addOnsRemoveSocketAddOnCardPayload: addOns {
				expansionSlotNumber 
				type 
			}
		}

	}	
}
